const SubCategoryCollectionStyles = styled.div`
  padding: 2rem;

  .collection-title {
    text-transform: uppercase;
  }
  .collection {
    display:flex;
    flex-wrap: wrap;
  }
`;

const CollectionTitleStyled = ``;

export { SubCategoryCollectionStyles };
